  false,\n\t\"url\": null,\n\t\"notes\": \"Chagvan Bay and Nanvak Bay are known to
  be important staging and/or stopover areas for large numbers of Pacific Brant (Branta
  bernicola) and Emperor Geese (Chen canagica), during spring and fall migrations
  (Weir et al, unpublished). Because of concern over the role spring subsistence hunting
  might play in the continued decline of Cackling Canada Goose, Pacific White-fronted
  Goose, Pacific Brant, and Alaskan Emperor Goose populations, we sought to gather
  information regarding the spring subsistence harvest, as well as the biology of
  geese at Chagvan Bay during the spring migration of 1984. In this report, we will
  summarize information we collected at Chagvan Bay from May 3, to June 1, 1984.\",\n\t\"owner_org\":
